import React, { useState } from 'react';
import './styles.css'
import Heading from "./Components/Heading"
import DieGroup from './Components/DieGroup';
import RollButton from "./Components/Button"
import randomNumbers from './Components/RandomNumber';

function App() {
  const [diceNumbers, setDiceNumbers] = useState(randomNumbers)

  setDiceNumbers(randomNumbers => randomNumbers.map(randomNumber => {
    return randomNumber
    }))

  return (
    <main>
      <Heading />
      <DieGroup number={diceNumbers}/>
      <RollButton roll="Roll"/>

    </main>
  )
}

export default App;
